def extract_features(text):
    return {word: True for word in text}


featuresets = [(extract_features(text), label) for text, label in labeled_corpus]


classifier = NaiveBayesClassifier.train(featuresets)


with open('classifier.pickle', 'wb') as file:
    pickle.dump(classifier, file)
    file.close()
print("–ö–ª–∞—Å—Å–∏—Ñ–∏–∫–∞—Ç–æ—Ä —Å–æ—Ö—Ä–∞–Ω–µ–Ω –≤ —Ñ–∞–π–ª 'classifier.pickle'")

